    PAE.test({
        "VectorSprite init" : function() {
            var self = this;
            var vec = new PAE.VectorSprite({
                frameRate : 1,
                vectorAnimations: {idle: [tree1], excited: [tree2, tree1]},
                animation: 'idle',
                x: 0,
                y: 0,
                width: 352,
                height: 405
            });
            this.layer.add(vec);
            vec.initalize(function() {
                vec.start();
                self.assert(vec.toDataURL() === tree1_cached, 'Cached image should look like a tree');
                vec.setAnimation('excited');
                self.assert(vec.toDataURL() === tree2_cached, 'setAnimation() switches animation');
                setTimeout(function() {
                    self.assert(vec.toDataURL() === tree1_cached, 'Animation iterates sucessfully');
                    self.done();
                }, 1500);
            })
        },
        "VectorSprite scaling": function() {
            var self = this;
            var vec = new PAE.VectorSprite({
                frameRate : 1,
                vectorAnimations: {idle: [tree1], excited: [tree2, tree1]},
                animation: 'idle',
                x: 0,
                y: 0,
                width: 352,
                height: 405,
                scale: {x: 0.5, y: 0.5}
            });
            this.layer.add(vec);
            vec.initalize(function() {
                vec.start();
                console.log(vec.toDataURL());
                self.assert(vec.toDataURL() === tree1_half_cached, 'half scaled tree looks like half scaled tree');
                self.done();
            })
        }
    })
